var Quality;
(function (Quality) {
    Quality["ALL"] = "All";
    Quality["SEVEN_TWENTY_P"] = "720p";
    Quality["TEN_EIGHTY_P"] = "1080p";
    Quality["THREE_D"] = "3D";
})(Quality || (Quality = {}));
var Sort;
(function (Sort) {
    Sort["TITLE"] = "title";
    Sort["YEAR"] = "year";
    Sort["RATING"] = "rating";
    Sort["PEERS"] = "peers";
    Sort["SEEDS"] = "seeds";
    Sort["DOWNLOAD_COUNT"] = "download_count";
    Sort["LIKE_COUNT"] = "like_count";
    Sort["DATE_ADDED"] = "date_added";
})(Sort || (Sort = {}));
var Order;
(function (Order) {
    Order["ASC"] = "asc";
    Order["DESC"] = "desc";
})(Order || (Order = {}));

export { Order, Quality, Sort };
